class Solution(object):
    def formWords(self,words):

        ans=[]
        if len(words)==0:
            return None
        if len(words)==1:
            return words

        for i in words:
            newList = words[:]
            newList.remove(i)
            newWords = self.formWords(newList)
            for j in newWords:
                if i+j not in ans:
                    ans.append(i+j)
        return ans

    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if len(s)==0:
            return []
        stringsToCheck = self.formWords(words)
        ans = []
        for word in stringsToCheck:
            if len(word)==0 or len(word)>len(s):
                continue
            for i in range(len(s)):
                index=i
                if i+len(word)<=len(s):
                    j=0
                    while j < len(word) and s[i]==word[j]:
                        i+=1
                        j+=1
                    if j == len(word):
                        ans.append(index)

        return ans
    
